$(document).ready(function(){getID()});function getID(){var a=getParameterByName("?");if(a===""){unFound()}var b=a.substr(0,1);if(b==="M"){getMovieDetails(a)}else{if(b==="T"){getTVDetails(a)}else{unFound()}}}function unFound(){document.location="/unfound.html";location.replace("/unfound.html")}function getMovieDetails(a){$.getJSON("/js/movies.json",function(h){for(var b in h){if(!h.hasOwnProperty(b)){console.log("prop fail");continue}if(h[b][0]["ID"]===a){var e=h[b][0]["Genre"];var i=h[b][0]["Director"];var c=h[b][0]["Time"];var g=h[b][0]["Title"];var f=h[b][0]["ID"];var j=h[b][0]["Plot"];$(".title").html(g);$(".Plot").html("Plot: "+j);$(".Genre").html("Genre: "+e);$(".Creator").html("Creator: "+i);$(".Runtime").html("Runtime: "+c+" mins");var d=document.getElementById("button");d.href="/play.html?="+f}}})}function getTVDetails(a){$.getJSON("/js/tv.json",function(k){for(var b in k){if(!k.hasOwnProperty(b)){console.log("prop fail");continue}var f=a.indexOf(".");var j=a.slice(0,f);if(k[b][0]["ID"]===j){var e=k[b][0]["Genre"];var l=k[b][0]["Creator"];var c=k[b][0]["Time"];var g=a.slice(f+1);var i=k[b][g]["ShortName"];var h=k[b][g]["EpisodeID"];var m=k[b][g]["Plot"];$(".title").html(i);$(".Plot").html("Plot: "+m);$(".Genre").html("Genre: "+e);$(".Creator").html("Creator: "+l);$(".Runtime").html("Runtime: "+c+" mins");var d=document.getElementById("button");d.href="/play.html?="+h}}})}function getParameterByName(b,a){if(!a){a=window.location.href}b=b.replace(/[\[\]]/g,"\\$&");var d=new RegExp("[?&]"+b+"(=([^&#]*)|&|#|$)"),c=d.exec(a);if(!c){return null}if(!c[2]){return""}return decodeURIComponent(c[2].replace(/\+/g," "))};